import React, { useState } from "react";
import axios from "axios";
import "../css/CreateResume.css"; // Import the CSS file

const ResumeForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    summary: "",
    skills: [],
    education: [{ degree: "", university: "", year: "" }],
    experience: [{ jobTitle: "", company: "", startDate: "", endDate: "", description: "" }],
  });

  const [pdfUrl, setPdfUrl] = useState(null); // State for PDF preview

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleArrayChange = (index, field, value, type) => {
    const updatedArray = [...formData[type]];
    updatedArray[index][field] = value;
    setFormData({ ...formData, [type]: updatedArray });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/generate-resume", formData, {
        responseType: "blob",
      });

      // Create a URL for the PDF blob
      const url = window.URL.createObjectURL(new Blob([response.data]));
      setPdfUrl(url); // Set the URL to preview the PDF

    } catch (error) {
      console.error("Error generating resume:", error);
    }
  };

  return (
    <div className="resume-container">
      <h2>Resume Builder</h2>
      
      {/* Resume Form */}
      <form className="resume-form" onSubmit={handleSubmit}>
        <input type="text" name="name" placeholder="Full Name" onChange={handleChange} required value={formData.name} />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} required value={formData.email} />
        <input type="text" name="phone" placeholder="Phone" onChange={handleChange} required value={formData.phone} />
        <textarea name="summary" placeholder="Summary" onChange={handleChange} required value={formData.summary}></textarea>

        <h3>Skills</h3>
        <input
          type="text"
          name="skills"
          placeholder="Comma separated skills"
          onChange={(e) => setFormData({ ...formData, skills: e.target.value.split(",") })}
          required
          value={formData.skills.join(", ")}
        />

        <h3>Education</h3>
        <div className="education-section">
          {formData.education.map((edu, index) => (
            <div key={index}>
              <input type="text" placeholder="Degree" value={edu.degree} onChange={(e) => handleArrayChange(index, "degree", e.target.value, "education")} />
              <input type="text" placeholder="University" value={edu.university} onChange={(e) => handleArrayChange(index, "university", e.target.value, "education")} />
              <input type="text" placeholder="Year" value={edu.year} onChange={(e) => handleArrayChange(index, "year", e.target.value, "education")} />
            </div>
          ))}
        </div>

        <h3>Experience</h3>
        <div className="experience-section">
          {formData.experience.map((exp, index) => (
            <div key={index}>
              <input type="text" placeholder="Job Title" value={exp.jobTitle} onChange={(e) => handleArrayChange(index, "jobTitle", e.target.value, "experience")} />
              <input type="text" placeholder="Company" value={exp.company} onChange={(e) => handleArrayChange(index, "company", e.target.value, "experience")} />
              <input type="text" placeholder="Start Date" value={exp.startDate} onChange={(e) => handleArrayChange(index, "startDate", e.target.value, "experience")} />
              <input type="text" placeholder="End Date" value={exp.endDate} onChange={(e) => handleArrayChange(index, "endDate", e.target.value, "experience")} />
              <textarea placeholder="Description" value={exp.description} onChange={(e) => handleArrayChange(index, "description", e.target.value, "experience")}></textarea>
            </div>
          ))}
        </div>

        <button type="submit" className="submit-btn">Generate Resume</button>
      </form>

      {/* PDF Preview Section */}
      {pdfUrl && (
        <div className="pdf-preview">
          <h3>Resume Preview</h3>
          <iframe src={pdfUrl} width="100%" height="500px" title="Resume Preview"></iframe>
          <a href={pdfUrl} download="resume.pdf" className="download-btn">Download PDF</a>
        </div>
      )}
    </div>
  );
};

export default ResumeForm;
